import Banner from '../../components/Banner'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import Card from '../../components/Card'
import logement from '../../assets/logements.json'

const HomeContainer = styled.div`
  widht: 100vw;
  height: 23vh;
  max-height: 1095px;
`

function Home() {
  return (
    <HomeContainer>
      <Banner />
      <CardsContainer>
        {logement?.map((fiche) => (
          <Link key={`logement-${logement.id}`} to={`/logement/${logement.id}`}>
            <Card title={logement.name} picture={logment.picture} />
          </Link>
        ))}
      </CardsContainer>
      }
    </HomeContainer>
  )
}

export default Home
